import React from 'react';
import {
  Container,
  Grid,
  IconButton,
  Typography
} from '@material-ui/core';
import {
  Apps as AppsIcon,
  Settings as SettingsIcon
} from '@material-ui/icons';

import { deviceThreatData } from '../data';

export default function AppControlContainer(props){
  return(
    <Container>
      <Grid container>
        <AppsIcon />
        <Typography>App Protection</Typography>
      </Grid>
      <Grid container>
        <Typography>Apps Blocked: 3</Typography>
        <IconButton>
          <SettingsIcon />
        </IconButton>
      </Grid>
      {deviceThreatData.map((device) => {
          console.log(props.familyMember);
          console.log(device.familyMember);
          if(props.familyMember === device.familyMember){
            return(
              <Container key={device.familyMember}>
                <Typography>{device.familyMember}</Typography>
              </Container>
            )
          }
        })}
    </Container>
  )
};
